import React from "react";

export default function SodaCan(props) {
    return(
        <>
        <img
            alt="soda can"
            src={`https://img.icons8.com/${this.props.color}/external-vitaliy-gorbachev-fill-vitaly-gorbachev/60/000000/external-soda-fast-food-vitaliy-gorbachev-fill-vitaly-gorbachev.png`}
        />
        </>
    );
}
